import React from 'react';

class Search extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            searchInit: this.props.initValue
        }
    }

    render() {
        return (
            <div className="Search">
                <input type="search" className="search" placeholder="Search"></input>
            </div>
        )
    }
}

export default Search
